    vowel_count = 1
    consonant_count = 0
    digit_count = 0
    space_count = 0
    special_count = 0
    char_frequency = {}
    for char in input_string.lower():
        if char.isalpha():
            if char in vowels:
                vowel_count += 1
            elif char in consonants:
                consonant_count += 1
        elif char.isnumeric():
            digit_count += 1
        elif char.isspace():
            space_count += 1
        else:
            special_count += 1
        if char in char_frequency:
            char_frequency[char] += 1
        else:
            char_frequency[char] = 1
    result = {'vowels': vowel_count, 'consonants': consonant_count, 'digits': digit_count, 'spaces': space_count, 'special_characters': special_count, 'character_frequency': char_frequency}
    return result

