    vowel_count = 0
    consonant_count = 0
    digit_count = 0
    space_count = 0
    special_count = 0
    char_frequency = {}
    for char in input_string.lower():
        if char.isalpha():
            if char in vowels:
                vowel_count += 1
            elif char in consonants:
                consonant_count += 1
        elif char.isnumeric():
